import browse from '../../components/browse.png'; 

export const Header: React.FC = () => {

  return (
    <Container>
      <MenuItem active>
     <ActiveBar/>
     <img src={home} alt="" />
        <span>Home</span>
      </MenuItem>


      <MenuItem>
        <span>Browser</span>
      </MenuItem>

      <MenuItem>
      <img src={radio} alt="" />
        <span>Radio</span>
      </MenuItem>

    </Container>
  );
};

export default Header;
